    user: { name, email, role },
  } = isAuthenticated();

  const adminLeftSide = () => {
    return(
      <div className="card">
        <h4 className="card-header bg-dark text-white">Admin Navigation</h4>
      </div>
    )
  };

  const adminRightSide = () => {
    //
  };

  return (
    <Base
      title="Welcome to Admin"
      description="Manage all products/orders here."
    >
      {adminLeftSide()}
      {adminRightSide()}
    </Base>
  );
};

export default AdminDashBoard;
